import React from "react";
import ReactDom from "react-dom";
const name = "Pawan Chauhan";
const img = require("./img1.jpeg");
https://picsum.photos/200/300.jpg
ReactDom.render(
  <>
    <h1 contentEditable="true">{`I am ${name}.I am a God`}</h1>
    <img src={img} alt="God Image" />
  </>,
  document.getElementById("root")
);
